void statusShrink()
{
	for(int i = 0; i < calNum; i++)
	{
		status_tem[i] = 1;
	}
	
	for(int i = shrink; i < calNum; i++)
	{
		if(status[i + shrink] == 6 || status[i - shrink] == 6)
			status_tem[i] = 6;
		
		if(status[i + shrink] == 9 || status[i - shrink] == 9)
			status_tem[i] = 9;
	}
	
	for(int i = 0; i < calNum; i++)
	{
		status[i] = status_tem[i];
	}
}

void SpeedStatus()
{
	for(int i = 0; i < speedStatusInt; i++)
	{	
		speedStatus[calNum] = 0;
	}
	
	for(int i = speedStatusInt; i < calNum; i++)
	{
		if(status[i] == 1 && status[i + speedStatusInt] == 1 && status[i - speedStatusInt] == 1)
			speedStatus[i] = 1;
	}
	
	for(int i = speedStatusInt; i < calNum; i++)
	{
		if(status[i] != 1 && status[i + speedStatusInt] != 1 && status[i - speedStatusInt] != 1)
			speedStatus[i] = 8;
	}
}

