{
	int firstValue = 0;
	int secondValue = 0;
	int valueSwitch = 1;
	
	for(int i = 0; i < calNum; i++)
	{
		if(valueSwitch == 1 && status[i] == 9)
			firstValue = i;
		else if(status[i] == 0)
			valueSwitch = 2;
		else if(valueSwitch == 2 && status[i] == 9)
		{
			secondValue = i;
			if(secondValue - firstValue < kFlatThr)
			{
				for(int j = (firstValue + 1); j < secondValue; j++)
					status[j] = status[j - 1];
			}
			firstValue = i;
			valueSwitch = 1;
		}
	}
}

