void statusZero()
{
	for(int i = 0; i < calNum; i++)
	{
		status_tem[i] 		= 0;	
		posL[i] 		= -10000;
		
		pixel_status[i] = 0;
	}
	for(int j = 0; j < 128; j++)
		point_status[j] = 0;
	
	flag_status = 0;
	print_status = 127;
}

